import React from "react";

const RestApiLogo = () => {
  return (
    <>
      <span style={{ textShadow: "2px 2px 3px darkgrey" }}>{`{`}</span>
      <span
        style={{
          color: "rgb(0, 156, 213)",
          fontWeight: "bold",
          textShadow: "2px 2px 3px rgb(0, 66, 123)",
        }}
      >
        REST:API
      </span>
      <span style={{ textShadow: "2px 2px 3px grey" }}>{`}`}</span>
    </>
  );
};

export default RestApiLogo;
